import * as React from "react";
import Button from "@mui/material/Button";
import Menu from "@mui/material/Menu";
import MenuItem from "@mui/material/MenuItem";
import Switch from "@mui/material/Switch";

export const BasicMenu = () => {
  const [anchorEl, setAnchorEl] = React.useState(null);
  const open = Boolean(anchorEl);
  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };
  const handleClose = () => {
    setAnchorEl(null);
  };

  return (
    <div>
      <Button
        id="basic-button"
        aria-controls={open ? "basic-menu" : undefined}
        aria-haspopup="true"
        aria-expanded={open ? "true" : undefined}
        onClick={handleClick}
      >
        Dashboard
      </Button>
      <Menu
        id="basic-menu"
        anchorEl={anchorEl}
        open={open}
        onClose={handleClose}
        MenuListProps={{
          "aria-labelledby": "basic-button",
        }}
      >
        <MenuItem onClick={handleClose}>Profile</MenuItem>
        <MenuItem onClick={handleClose}>My account</MenuItem>
        <MenuItem>
          <BasicMenuNew />
        </MenuItem>
      </Menu>
    </div>
  );
};
const BasicMenuNew = () => {
  const [anchorEl, setAnchorEl] = React.useState(null);
  const open = Boolean(anchorEl);
  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };
  const handleClose = () => {
    setAnchorEl(null);
  };
  const label = { inputProps: { "aria-label": "Switch demo" } };

  return (
    <div>
      <p
        id="basic-button"
        aria-controls={open ? "basic-menu" : undefined}
        aria-haspopup="true"
        aria-expanded={open ? "true" : undefined}
        onClick={handleClick}
        className=" mb-0"
      >
        Dashboard
      </p>
      <Menu
        id="basic-menu"
        anchorEl={anchorEl}
        open={open}
        onClose={handleClose}
        MenuListProps={{
          "aria-labelledby": "basic-button",
        }}
        className="Dashboard_menu_right_inner"
      >
        <MenuItem className="Dashboard_menu_right_inner_item">
          Progress
          <Switch
            className="Dashboard_menu_right_inner_item_switch"
            {...label}
            size="small"
          />
        </MenuItem>
        <MenuItem>
          <div className="Dashboard_menu_right_inner_item">
            Task Status
            <Switch
              className="Dashboard_menu_right_inner_item_switch"
              {...label}
              size="small"
            />
          </div>
        </MenuItem>
        <MenuItem>
          <div className="Dashboard_menu_right_inner_item">
            Team Status
            <Switch
              className="Dashboard_menu_right_inner_item_switch"
              {...label}
              size="small"
            />
          </div>
        </MenuItem>
        <MenuItem>
          <div className="Dashboard_menu_right_inner_item">
            Issue Status
            <Switch
              className="Dashboard_menu_right_inner_item_switch"
              {...label}
              size="small"
            />
          </div>
        </MenuItem>
        <MenuItem>
          <div className="Dashboard_menu_right_inner_item">
            Weekly Digest
            <Switch
              className="Dashboard_menu_right_inner_item_switch"
              {...label}
              size="small"
            />
          </div>
        </MenuItem>
        <MenuItem>
          <div className="Dashboard_menu_right_inner_item">
            Milestone Status
            <Switch
              className="Dashboard_menu_right_inner_item_switch"
              {...label}
              size="small"
            />
          </div>
        </MenuItem>
        <MenuItem>
          <div className="Dashboard_menu_right_inner_item">
            Project Cost
            <Switch
              className="Dashboard_menu_right_inner_item_switch"
              {...label}
              size="small"
            />
          </div>
        </MenuItem>
        <MenuItem>
          <div className="Dashboard_menu_right_inner_item">
            Bugs/Issues
            <Switch
              className="Dashboard_menu_right_inner_item_switch"
              {...label}
              size="small"
            />
          </div>
        </MenuItem>
      </Menu>
    </div>
  );
};
